import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css'; //부트스트랩 적용
//import {Button} from "react-bootstrap";
import MenuBar from './component/MenuBar';
import axios from "axios";
function App() {
  useEffect(()=> {
    axios.get('/api')
    .then(res => console.log(res))
    .catch()
  })
  return (
    
    <>
    <div className="App Container">
      <MenuBar/>
    </div>
    </>
  );
}

export default App;
